import './index.css'
import { departments } from './vendor/constants';
import Card from './components/Card';
// import Department from './components/Department';

function App() {

  function getDepartment() {
    departments.map((department) => {
      return department
    })
  }

  return (
   <div className='page'>
    <div className='content'>
      <Card title={getDepartment()}/>

    </div>

   </div>
  );
}

export default App;
